CREATE DEFINER=`root`@`localhost` PROCEDURE `CheckExistAccount` (IN `accountNameString` VARCHAR(40), IN `phoneString` VARCHAR(40), OUT `status` INT)  BEGIN
DECLARE tmpusername VARCHAR(40);
DECLARE tmpphone VARCHAR(40);
SET status = 0;
SELECT phone INTO tmpphone FROM user WHERE phone = phoneString;
IF tmpphone = phoneString
THEN SET status = 2;
END IF;
