THEN SET status = 1;
END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ConfirmBooking` (IN `numberofRoom` INT, IN `hotelID` INT, IN `checkinDate` DATE, IN `checkoutDate` DATE, IN `userID` INT)  BEGIN
	DECLARE done INT DEFAULT 0;
    DECLARE counter INT DEFAULT 0;
    DECLARE roomID INT ;
    DECLARE DateNow DATE;
    DECLARE RoomPrice INT;
	DECLARE curRoomID CURSOR 
	FOR (SELECT id FROM room WHERE hotel_id = hotelID
	AND id NOT IN 
         (SELECT room_id FROM receipt 
        WHERE status !=2 
        AND hotel_id = hotelID 
        AND ((checkin_date <= checkinDate AND checkout_date >= checkoutDate) 
         OR   (checkin_date >= checkinDate AND checkin_date  <= checkoutDate)
         OR   (checkout_date >= checkinDate AND checkout_date <= checkoutDate)
			)
		)
    );
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
    SET RoomPrice = GetPriceForRoom(hotelID, checkinDate, checkoutDate);
    SELECT CURDATE() INTO DateNow;
    OPEN curRoomID;
    GetRoomID: LOOP
         FETCH curRoomID INTO roomID;
         IF done = 1 THEN 
			LEAVE GetRoomID;
            END IF;
         IF counter < numberofRoom THEN
         SET counter = counter + 1;
         ELSE 
         	SET done = 1;
         END IF;
    END LOOP GetRoomID;
CLOSE curRoomID;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `FilteredSearch` (IN `destination` VARCHAR(40), IN `hotelname` TEXT, IN `star` INT, IN `FilterString` TEXT)  BEGIN
