        IF (destination != '') THEN
            SET flagDestinationEmpty = 0;
        END IF;
        IF (hotelname != '') THEN
            SET flagHotelNameEmpty = 0;
        END IF;
        IF (star != 0) THEN
            SET flagStarEmpty = 0;
        END IF;
        SET @querysmt = (SELECT CONCAT(@querysmt, @querysmt1)); 
    END IF;
    IF (FilterString != '') THEN 
        SET @querysmt = (SELECT CONCAT(@querysmt, ' WHERE ', FilterString));
        IF (flagDestinationEmpty = 0) THEN 
            SET @querysmt = (SELECT CONCAT(@querysmt, ' AND ', @conditionDestination));
        END IF;
        IF (flagHotelNameEmpty = 0) THEN 
            SET @querysmt = (SELECT CONCAT(@querysmt, ' AND ', @conditionHotelName));
        END IF;
        IF (flagStarEmpty = 0) THEN 
            SET @querysmt = (SELECT CONCAT(@querysmt, ' AND ', @conditionStar));
        END IF;
    ELSE 
        IF (flagDestinationEmpty = 0) THEN 
            SET @querysmt = (SELECT CONCAT(@querysmt, ' WHERE ', @conditionDestination));
            IF (flagHotelNameEmpty = 0) THEN 
                SET @querysmt = (SELECT CONCAT(@querysmt, ' AND ', @conditionHotelName));
            END IF;
            IF (flagStarEmpty = 0) THEN 
                SET @querysmt = (SELECT CONCAT(@querysmt, ' AND ', @conditionStar));
            END IF;
        ELSE
            IF (flagHotelNameEmpty = 0) THEN 
                SET @querysmt = (SELECT CONCAT(@querysmt, ' WHERE ', @conditionHotelName));
                IF (flagStarEmpty = 0) THEN 
                    SET @querysmt = (SELECT CONCAT(@querysmt, ' AND ', @conditionStar));
            	END IF;
            ELSE
                IF (flagStarEmpty = 0) THEN 
                    SET @querysmt = (SELECT CONCAT(@querysmt, ' WHERE ', @conditionStar));
                END IF;
            END IF;
        END IF;
    END IF;
   	PREPARE smt FROM @querysmt;
    EXECUTE smt;
END$$

