CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateReceiptStatus` (IN `receiptID` INT, IN `datenow` DATE)  BEGIN
	DECLARE receiptstatus INT;
    DECLARE checkinDate DATE;
    DECLARE checkoutDate DATE;
	SELECT status, checkin_date, checkout_date INTO receiptstatus, checkinDate, checkoutDate FROM receipt 		WHERE id = receiptID;
	IF receiptstatus = 0 THEN
		IF checkinDate <= datenow THEN
			UPDATE receipt SET status = 1 WHERE id = receiptID;
        END IF;
    ELSE
    	IF checkoutDate < datenow THEN
        	UPDATE receipt SET status = -1 WHERE id = receiptID;
        END IF;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateReceiptStatusHotel` (IN `HotelID` INT)  BEGIN 
DECLARE done INT DEFAULT 0;
DECLARE receiptStatus INT;
DECLARE receiptID INT;
DECLARE DateNow DATE;
DECLARE curReceipt CURSOR 
FOR 
(SELECT receipt.id FROM receipt 
 JOIN room ON (receipt.room_id = room.id) 
 JOIN hotel ON (room.hotel_id = hotel.id) 
 WHERE hotel_id = HotelID);
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
OPEN curReceipt;
getReceiptID: LOOP
	FETCH curReceipt INTO receiptID;
    IF done = 1 THEN 
			LEAVE getReceiptID;
		END IF;
	SELECT CURDATE() INTO DateNow;
	CALL UpdateReceiptStatus(receiptID, DateNow);
END LOOP getReceiptID;
CLOSE curReceipt;
END$$

