CREATE DEFINER=`root`@`localhost` FUNCTION `GetDestinationString` (`destination` TEXT) RETURNS TEXT CHARSET utf8 BEGIN
	SET @destination1 = (SELECT CONCAT("'%",destination, "%'"));
    SET @destination2 = (SELECT CONCAT("'",destination, "%'"));
    SET @destination3 = (SELECT CONCAT("'%",destination, "'"));
    SET @conditionDestination = (SELECT CONCAT(' ( province.name like ',@destination1,' OR province.name LIKE ',@destination2,' OR province.name LIKE ',@destination3," OR province.name LIKE '",destination,"')"));
    RETURN (@conditionDestination);
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `GetHotelIDByReceiptID` (`receiptID` INT) RETURNS INT(11) BEGIN
DECLARE hotelID INT;
SELECT hotel.id INTO hotelID
FROM hotel,room,
(SELECT * FROM receipt WHERE id = receiptID) AS instance 
WHERE instance.room_id = room.id 
AND room.hotel_id = hotel.id;
RETURN(hotelID);
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `GetHotelNameString` (`hotelname` TEXT) RETURNS TEXT CHARSET utf8 BEGIN
