CREATE DEFINER=`root`@`localhost` FUNCTION `GetNumberOfAvailableRooms` (`hotelID` INT, `checkinDate` DATE, `checkoutDate` DATE) RETURNS INT(11) BEGIN
DECLARE availableRoom INT;
SELECT COUNT(id) INTO availableRoom FROM room WHERE hotel_id = hotelID
AND id NOT IN (SELECT room_id FROM receipt WHERE status !=2 AND hotel_id = hotelID 
               AND ((checkin_date <= checkinDate AND checkout_date >= checkoutDate)
               OR   (checkin_date >= checkinDate AND checkin_date  <= checkoutDate)
               OR   (checkout_date >= checkinDate AND checkout_date <= checkoutDate)
                   )
              );
RETURN(availableRoom);  
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `GetPriceForRoom` (`hotelID` INT, `checkinDate` DATE, `checkoutDate` DATE) RETURNS BIGINT(20) BEGIN
DECLARE RoomPrice INT;
SELECT price * DATEDIFF(checkoutDate, checkinDate) INTO RoomPrice FROM hotel WHERE id = hotelID;
RETURN(RoomPrice);
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `GetTotalPriceForReceipt` (`numberofRoom` INT, `hotelID` INT, `checkinDate` DATE, `checkoutDate` DATE) RETURNS INT(11) BEGIN
    IF numberofRoom <= GetNumberOfAvailableRooms(hotelID, checkinDate, checkoutDate) THEN
        RETURN(SELECT price * numberofRoom * DATEDIFF(checkoutDate, checkinDate) AS totalprice FROM hotel WHERE id = hotelID);
    ELSE
        RETURN(0);
    END IF;
END$$

